const PRIMARY = '#252B63';
const SECONDARY = '#F21D52';
const WHITE = '#FFFFFF';
const BLACK = '#0C1229';

// ACTIONS
const SUCCESS = '#3adb76';
const WARNING = '#ffae00';
const ALERT = '#cc4b37';

// GRAYSCALE
const GRAY_LIGHT = '#e6e6e6';
const GRAY_MEDIUM = '#cacaca';
const GRAY_DARK = '#8a8a8a';
const GRAY_BLUE_LIGHT = '#E0EDF5';
const GRAY_BLUE_DARK = '#CCDDEE';

export default {
    PRIMARY,
    SECONDARY,
    WHITE,
    BLACK,
    SUCCESS,
    WARNING,
    ALERT,
    GRAY_LIGHT,
    GRAY_MEDIUM,
    GRAY_DARK,
    GRAY_BLUE_LIGHT,
    GRAY_BLUE_DARK
}
